var util          = require("util");
var RequestHeader = require("../request");

function IfNoneMatchHeader(value) {
    RequestHeader.call(this, value);
}

util.inherits(IfNoneMatchHeader, RequestHeader);

IfNoneMatchHeader.prototype.getKey = function() {
    return "If-None-Match";
};

module.exports = IfNoneMatchHeader;
